import React from 'react'
import Revenue from './Card_assets/Icons_1.png'

const Vcard = ({codes}) => {
    
  return (
    <div>
        <img src={Revenue} alt="revenue" class='bg-white'></img>
        <div class='text-sm font-bold inline'>{codes.num}</div>
        <div class='text-xs '>{codes.text}</div>
    </div>
  )
}

export default Vcard
